    function calculateRMC() {
        var appraised_value = strtoFloat($('#appraised_value').val());
        var eligible_amount = strtoFloat($('#eligible_amount').val());
        var libor_swap_rate = strtoFloat($('#libor_swap_rate').val());
        var lenders_margin = strtoFloat($('#lenders_margin').val());
        var monthly_insurance_premium = strtoFloat($('#monthly_insurance_premium').val());
        var youngest_eligible_spouse = strtoInt($('#youngest_eligible_spouse').val());
        var principal_limit_factor = strtoFloat($('#principal_limit_factor').val());
        var age = strtoInt($('#age').val());
        var modified_expected_rate = strtoFloat($('#modified_expected_rate').val());
        var loan_origination_fee = strtoFloat($('#loan_origination_fee').val());
        var loan_origination_fee_max = strtoFloat($('#loan_origination_fee_max').val());
        var initial_mortgage_insurance = strtoFloat($('#initial_mortgage_insurance').val());
        var other_closing_costs = strtoFloat($('#other_closing_costs').val());
        var total_upfront_costs = strtoFloat($('#total_upfront_costs').val());
        var upfront_costs_to_be_financed = strtoFloat($('#upfront_costs_to_be_financed').val());
        var lesa_requirements = strtoFloat($('#lesa_requirements').val());
        var available_hecm_credit = strtoFloat($('#available_hecm_credit').val());
        var tenure_payment_monthly = strtoFloat($('#tenure_payment_monthly').val());
        var tenure_payment_annual = strtoFloat($('#tenure_payment_annual').val());
        var payout_rate = strtoFloat($('#payout_rate').val());
        var desired_term_horizon = strtoInt($('#desired_term_horizon').val());
        var term_payment_monthly = strtoFloat($('#term_payment_monthly').val());
        var term_payment_annual = strtoFloat($('#term_payment_annual').val());
        var will_you_borrow = strtoInt($('#will_you_borrow :selected').val());

        eligible_amount = Math.min(625500, appraised_value);

        modified_expected_rate = Math.max(5, Math.min(10, okrvniz((libor_swap_rate + lenders_margin), 0.125)));

        age = youngest_eligible_spouse;

        principal_limit_factor = getPlf(modified_expected_rate, age);

        loan_origination_fee_max = Math.min(6000, Math.round(eligible_amount < 200000 ? eligible_amount * 0.02 : (0.02 * 200000 + 0.01 * (eligible_amount - 200000))));

        if(will_you_borrow == 1) {
            initial_mortgage_insurance = Math.round(0.005 * eligible_amount);
        }else{
            initial_mortgage_insurance = Math.round(0.025 * eligible_amount);
        }

        total_upfront_costs = loan_origination_fee + initial_mortgage_insurance + other_closing_costs;

        available_hecm_credit = eligible_amount * principal_limit_factor / 100 - total_upfront_costs * upfront_costs_to_be_financed / 100 - lesa_requirements;

        tenure_payment_monthly = pmt((libor_swap_rate + lenders_margin + monthly_insurance_premium) / (12 * 100), (100 - youngest_eligible_spouse) * 12, -available_hecm_credit, 0, 1) || 0;

        tenure_payment_annual = tenure_payment_monthly * 12;

        payout_rate = (tenure_payment_annual * 100 / (available_hecm_credit + total_upfront_costs * upfront_costs_to_be_financed / 100)) || 0;

        term_payment_monthly = pmt((libor_swap_rate + lenders_margin + monthly_insurance_premium) / (12 * 100), Math.min(desired_term_horizon * 12, (100 - youngest_eligible_spouse) * 12), -available_hecm_credit, 0, 1);

        term_payment_annual = term_payment_monthly * 12;

        $('#eligible_amount').val('$'+number_format(eligible_amount, 0, '.', ','));
        $('#modified_expected_rate').val(modified_expected_rate.toFixed(3)+'%');
        $('#age').val(age);
        $('#principal_limit_factor').val(principal_limit_factor.toFixed(2)+'%');
        $('#loan_origination_fee_max').val('$'+number_format(loan_origination_fee_max, 0, '.', ','));
        $('#initial_mortgage_insurance').val('$'+number_format(initial_mortgage_insurance, 0, '.', ','));
        $('#total_upfront_costs').val('$'+number_format(total_upfront_costs, 0, '.', ','));
        $('#available_hecm_credit').val('$'+number_format(Math.round(available_hecm_credit), 0, '.', ','));
        $('#tenure_payment_monthly').val('$'+number_format(Math.round(tenure_payment_monthly), 0, '.', ','));
        $('#tenure_payment_annual').val('$'+number_format(Math.round(tenure_payment_annual), 0, '.', ','));
        $('#payout_rate').val(payout_rate.toFixed(2)+'%');
        $('#term_payment_monthly').val('$'+number_format(Math.round(term_payment_monthly), 0, '.', ','));
        $('#term_payment_annual').val('$'+number_format(Math.round(term_payment_annual), 0, '.', ','));

    }

    function strtoFloat(str) {
        if (str === undefined || str === null) {
            return 0; // or handle the error as needed
        }
        var num = str.replace(/[\s\,\%\$]/g, "");
        return parseFloat(num) || 0;
    }


    function strtoInt(str) {
        if (typeof str !== 'string') {
            return 0; // Or handle the error as required
        }
        var num = str.replace(/[^0-9]/g, "");
        return parseInt(num) || 0;
    }


    function okrvniz(num, precision) {
        precision = precision || 1;
        if (precision <= 0) {
            precision = 1;
        }
        var res = (precision * Math.floor(num / precision))

        return res
    }

    function getPlf(num, key) {
        num = num || 0;
        key = key || 0;

        if(key > 90){
            key = 90;
        }

        var res = 0;

        $.each(plf, function (index, value) {
            if (value['Expected Rate'] == num) {
                res = value[key] || 0;
            }
        });

        return res;
    }

    function pmt(rate_per_period, number_of_payments, present_value, future_value, type) {

        if (rate_per_period != 0.0 && number_of_payments != 0.0) {
            // Interest rate exists
            var q = Math.pow(1 + rate_per_period, number_of_payments);
            return -(rate_per_period * (future_value + (q * present_value))) / ((-1 + q) * (1 + rate_per_period * (type)));

        } else if (number_of_payments != 0.0) {
            // No interest rate, but number of payments exists
            return -(future_value + present_value) / number_of_payments;
        }

        return 0;
    }


    function whatDecimalSeparator() {
        var n = 1.1;
        n = n.toLocaleString().substring(1, 2);
        return n;
    }


    function number_format(number, decimals, dec_point, thousands_sep) {

        var i, j, kw, kd, km;

        // input sanitation & defaults
        if (isNaN(decimals = Math.abs(decimals))) {
            decimals = 2;
        }
        if (dec_point == undefined) {
            dec_point = ",";
        }
        if (thousands_sep == undefined) {
            thousands_sep = ".";
        }

        i = parseInt(number = (+number || 0).toFixed(decimals)) + "";

        if ((j = i.length) > 3) {
            j = j % 3;
        } else {
            j = 0;
        }

        km = (j ? i.substr(0, j) + thousands_sep : "");
        kw = i.substr(j).replace(/(\d{3})(?=\d)/g, "$1" + thousands_sep);
        kd = (decimals ? dec_point + Math.abs(number - i).toFixed(decimals).replace(/-/, 0).slice(2) : "");

        return km + kw + kd;
    }
